-- ----------------------------
--  Table structure for `device_beetle_data`
-- ----------------------------
DROP TABLE IF EXISTS `device_beetle_data`;
CREATE TABLE `device_beetle_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `device_id` varchar(255) DEFAULT NULL,
  `change_date` datetime DEFAULT NULL,
  `change_times` int(11) DEFAULT NULL,
  `beetle_num` int(11) DEFAULT NULL,
  `sample_alive` tinyint(4) DEFAULT NULL COMMENT '样株死亡情况',
  `pine_death_num` int(11) DEFAULT NULL COMMENT '样株10米、10-150米半径范围死亡松树数量',
  `epidemic_area` tinyint(4) DEFAULT NULL COMMENT '诱捕器是否疫点小班',
  PRIMARY KEY (`id`),
  KEY `device_beetle_data.device_id` (`device_id`),
  CONSTRAINT `device_beetle_data.device_id` FOREIGN KEY (`device_id`) REFERENCES `device` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_code`
-- ----------------------------
DROP TABLE IF EXISTS `device_code`;
CREATE TABLE `device_code` (
  `id` varchar(255) NOT NULL,
  `province` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `area` varchar(255) DEFAULT NULL,
  `town` varchar(255) DEFAULT NULL,
  `adcode` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_deviceId` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_deadtrees_maintance`
-- ----------------------------
DROP TABLE IF EXISTS `device_deadtrees_maintance`;
CREATE TABLE `device_deadtrees_maintance` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `device_Id` bigint(20) DEFAULT NULL,
  `serial` varchar(255) DEFAULT NULL,
  `submit_date` datetime DEFAULT NULL,
  `batch` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `woodDiameter` varchar(255) DEFAULT NULL,
  `woodHeight` varchar(255) DEFAULT NULL,
  `woodVolume` varchar(255) DEFAULT NULL,
  `KillMethod` varchar(255) DEFAULT NULL,
  `Worker` varchar(255) DEFAULT NULL,
  `Remarks` varchar(255) DEFAULT NULL,
  `scanId` bigint(20) DEFAULT NULL,
  `Pic` varchar(255) DEFAULT NULL,
  `username` varchar(30) DEFAULT NULL,
  `region` varchar(30) DEFAULT NULL,
  `altitude` varchar(255) DEFAULT NULL,
  `accuracy` varchar(255) DEFAULT NULL,
  `town` varchar(255) DEFAULT NULL,
  `reported` int(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=186 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT;

