-- ----------------------------
--  Table structure for `device_forest_data`
-- ----------------------------
DROP TABLE IF EXISTS `device_forest_data`;
CREATE TABLE `device_forest_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `device_id` varchar(255) DEFAULT NULL,
  `slope_position` varchar(255) DEFAULT NULL COMMENT '坡位',
  `slope_direction` varchar(255) DEFAULT NULL COMMENT '坡向',
  `forest_structure` varchar(255) DEFAULT NULL COMMENT '林分类型',
  `avg_height` double DEFAULT NULL COMMENT '平均高度',
  `avg_dbh` double DEFAULT NULL COMMENT '平均胸径',
  `forest_structure_density` int(11) DEFAULT NULL COMMENT '林分密度',
  `crown_density` double DEFAULT NULL COMMENT '郁闭度',
  PRIMARY KEY (`id`),
  KEY `device_forest_info.device_id` (`device_id`),
  CONSTRAINT `device_forest_info.device_id` FOREIGN KEY (`device_id`) REFERENCES `device` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_img`
-- ----------------------------
DROP TABLE IF EXISTS `device_img`;
CREATE TABLE `device_img` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `img_name` varchar(255) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `device_id` varchar(255) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `device_img_uername` (`username`),
  KEY `device_img_device_id` (`device_id`),
  CONSTRAINT `device_img_uername` FOREIGN KEY (`username`) REFERENCES `user` (`username`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=30426 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

