-- ----------------------------
--  Table structure for `device_maintenance_abnormal`
-- ----------------------------
DROP TABLE IF EXISTS `device_maintenance_abnormal`;
CREATE TABLE `device_maintenance_abnormal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `device_id` varchar(255) DEFAULT NULL COMMENT '设备ID',
  `batch` int(11) DEFAULT NULL COMMENT '批次',
  `num` int(11) DEFAULT NULL COMMENT '松墨天牛数量',
  `other_type` tinyint(255) DEFAULT NULL COMMENT '其他天牛类型',
  `other_num` int(11) DEFAULT NULL COMMENT '其他天牛数量',
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `date` datetime DEFAULT NULL COMMENT '日期',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  `altitude` double DEFAULT NULL COMMENT '海拔',
  `img_id` varchar(255) DEFAULT NULL COMMENT '图片ID',
  `drug` varchar(255) DEFAULT NULL COMMENT '药剂类型',
  `remark` longtext COMMENT '备注',
  `working_content` tinyint(255) DEFAULT NULL COMMENT '工作内容',
  `male_num` int(11) DEFAULT NULL,
  `female_num` int(11) DEFAULT NULL,
  `isactive` tinyint(255) DEFAULT NULL,
  `scanId` bigint(20) DEFAULT NULL,
  `project` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_maintenance_copy1`
-- ----------------------------
DROP TABLE IF EXISTS `device_maintenance_copy1`;
CREATE TABLE `device_maintenance_copy1` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `device_id` varchar(255) DEFAULT NULL COMMENT '设备ID',
  `batch` int(11) DEFAULT NULL COMMENT '批次',
  `num` int(11) DEFAULT NULL COMMENT '松墨天牛数量',
  `other_type` tinyint(255) DEFAULT NULL COMMENT '其他天牛类型',
  `other_num` int(11) DEFAULT NULL COMMENT '其他天牛数量',
  `male_num` int(11) DEFAULT NULL,
  `female_num` int(11) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `date` datetime DEFAULT NULL COMMENT '日期',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  `altitude` double DEFAULT NULL COMMENT '海拔',
  `img_id` varchar(255) DEFAULT NULL COMMENT '图片ID',
  `drug` varchar(255) DEFAULT NULL COMMENT '药剂类型',
  `remark` longtext COMMENT '备注',
  `working_content` tinyint(255) DEFAULT NULL COMMENT '工作内容',
  `reported` tinyint(255) DEFAULT NULL COMMENT '是否上报',
  `scanId` bigint(20) DEFAULT NULL,
  `project` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_map`
-- ----------------------------
DROP TABLE IF EXISTS `device_map`;
CREATE TABLE `device_map` (
  `device_id` varchar(255) NOT NULL COMMENT '这个是唯一的',
  `user_id` varchar(255) NOT NULL,
  `scanId` bigint(11) DEFAULT NULL COMMENT '这个生成二维码用的',
  `uniqueId` varchar(11) DEFAULT NULL COMMENT '这个并不是唯一，只是前端展示好看用的',
  `project` varchar(255) DEFAULT NULL,
  `region` varchar(255) DEFAULT NULL,
  `prefix` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`device_id`,`user_id`),
  KEY `device_map.user_id` (`user_id`),
  CONSTRAINT `device_map.device_id` FOREIGN KEY (`device_id`) REFERENCES `device` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `device_map.user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`username`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `device_medicine_maintance`
-- ----------------------------
DROP TABLE IF EXISTS `device_medicine_maintance`;
CREATE TABLE `device_medicine_maintance` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `device_id` bigint(20) DEFAULT NULL,
  `serial` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '编号',
  `region` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '区名',
  `submit_date` datetime DEFAULT NULL,
  `batch` int(11) DEFAULT NULL,
  `longitude` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `latitude` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `medicine_qua` double(255,2) DEFAULT NULL COMMENT '药剂质量（kg为单位）',
  `medicine_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '药剂名称',
  `area_fz` double(255,0) DEFAULT NULL COMMENT '防止面积',
  `work_content` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `worker` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `pic` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `reported` tinyint(255) DEFAULT NULL,
  `username` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `dataPrecision` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `town` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `altitude` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `scanId` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT;

