-- ----------------------------
DROP TABLE IF EXISTS `hourly_weather`;
CREATE TABLE `hourly_weather` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `adcode` varchar(255) DEFAULT NULL COMMENT '地区代码',
  `fl` varchar(255) DEFAULT NULL COMMENT '体感温度',
  `tmp` int(11) DEFAULT NULL COMMENT '温度',
  `cond_code` varchar(255) DEFAULT NULL COMMENT '天气状态码',
  `cond_txt` varchar(255) DEFAULT NULL COMMENT '天气文字',
  `wind_deg` int(11) DEFAULT NULL COMMENT '风向角度',
  `wind_dir` varchar(255) DEFAULT NULL COMMENT '风向',
