  `pcpn` double(255,0) DEFAULT NULL COMMENT '降水量',
  `pres` int(11) DEFAULT NULL COMMENT '大气压',
  `vis` int(11) DEFAULT NULL COMMENT '能见度(公里)',
  `cloud` int(11) DEFAULT NULL COMMENT '云量',
  `date` datetime DEFAULT NULL COMMENT '日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45187 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

